COMPONENT.script:
#define $INFO		'curexec.Trace'
#define $trigger	'FormField(curframe.TriggerField)'

initialize()=
declare
	tabf					= TabFolder default null;
	tbar					= TabBar default null;
	tab1					= TabField default null;
	tab2					= TabField default null;
	tab3					= TabField default null;

	tab_bgbitmap			= BitmapObject default null;
	tab_norbitmap			= BitmapObject default null;
	tab_selbitmap			= BitmapObject default null;

	status					= integer not null default ER_OK;
	trigger					= FormField default null;

	SetupVariables			= procedure returning integer not null;
	SetupTabBitmaps			= procedure returning integer not null;
	SetupTabHighlighting	= procedure returning integer not null;
enddeclare
{
	status = SetupVariables();
}


/*
**	@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
**							EVENTS
**	@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
*/
/*
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Prepare the tabfields for mouseover highlighting 
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on click addtabbitmapsbtn =
{
	status = SetupTabBitmaps();
	$trigger.CurBias = FB_INVISIBLE;
}


/*
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Prepare the tabfields for mouseover highlighting 
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on click addhighlightbtn =
{
	status = SetupTabHighlighting();
	$trigger.CurBias = FB_INVISIBLE;
}


/*
**	@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
**							PROCEDURES
**	@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
*/
/*
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Prepare the frame variables
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupVariables(

)=
{
	tabf = field(testtabf);
	tbar = tabf.TabBar;
	tab1 = tabf.TabPageArray[1].TabField;
	tab2 = tabf.TabPageArray[2].TabField;
	tab3 = tabf.TabPageArray[3].TabField;

	tab_bgbitmap = field(tabfield_bgbitmap).Image;
	tab_norbitmap = field(tabfield_normalbitmap).Image;
	tab_selbitmap = field(tabfield_selectedbitmap).Image;

	return ER_OK;
}


/*
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Prepare the tabfields to display bitmapped (gradiented) backgrounds
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupTabBitmaps(

)=
declare
	afld			= ActiveField;
enddeclare
{
	tab1.HasBitmap = TRUE;
	tab2.HasBitmap = TRUE;
	tab3.HasBitmap = TRUE;

	tab1.TextLabel = 'Search';
	tab2.TextLabel = 'Navigation';
	tab3.TextLabel = 'Details';

	/*
	**	Set the cornersize of the tabfield bitmaps to ensure that when displayed,
	**	the bitmaps resize to the tab, and that their border regions (defined by
	**	the cornersize) are preserved
	*/
	afld.BgBitmap = tab_norbitmap;
	afld.UpdBackground(cornersize=3);
	afld.BgBitmap = tab_selbitmap;
	afld.UpdBackground(cornersize=3);

	/*
	**	Apply the tabfield bitmaps;
	**	Set the appropriate TabShape and BitmapPosition for bitmapped tabs;
	**	Ensure XMargin, YMargin and Separation are appropriate for the visual effect
	*/
	tab1.NormalBitmap = tab_norbitmap.Duplicate();
	tab2.NormalBitmap = tab_norbitmap.Duplicate();
	tab3.NormalBitmap = tab_norbitmap.Duplicate();

	tab1.SelectedBitmap = tab_selbitmap.Duplicate();
	tab2.SelectedBitmap = tab_selbitmap.Duplicate();
	tab3.SelectedBitmap = tab_selbitmap.Duplicate();

	tbar.TabShape = COR_BITMAPPED;
	tbar.BitmapPosition = POS_CENTER;

	tbar.XMargin = 4;
	tbar.yMargin = 2;
	tbar.Separation = 3;

	return ER_OK;
}


/*
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Prepare the tabfields for mouseover highlighting 
**	~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	We store the "highlight/unhighlight" images as the tabfields' BgBitmap - this
**	will only ever display in response to a mouseentertab or mouseexittab defined
**	behavior. Then we create and store these defined behaviours to perform the
**	highlighting.
**	Note that these settings could have been added in advance, using a Setup Frame
**	via the Property Inspector.
*/
procedure SetupTabHighlighting(

)=
declare
	IE				= InputEvent;
	response		= Object default null;
	eventkey		= varchar(32) not null;
enddeclare
{
	/*
	**	Apply the highlight bitmap to each of the tabfields
	*/
	tab1.BgBitmap = tab_bgbitmap.Duplicate();
	tab2.BgBitmap = tab_bgbitmap.Duplicate();
	tab3.BgBitmap = tab_bgbitmap.Duplicate();

	/*
	**	Enable the tabbar to handle defined-behaviours;
	**	Apply the "highlight" defined-behaviour to the tabbar;
	**	Apply the "no-highlight" defined-behaviour to the tabbar
	**
	**	(Windows7 tabfields highlight on mouseover only if unselected. This demo
	**	simulates this by using identical highlight and unhighlight images for
	**	the selected tab) 
	*/
	tbar.SetTaggedValue(tag='inputevent_enabled');

	response = IE.Response(type='image', imageindex=2);
	eventkey = IE.EventKey(
		action=IE_MOUSEENTER, modifierkey=KB_NONE, responsecode=RE_MOUSEENTERTAB);
	IE.LoadEventBehavior(
		location=tbar, eventkey=eventkey,
		responsetype='event_responses', response=response);	

	response = IE.Response(type='image', imageindex=1);
	eventkey = IE.EventKey(
		action=IE_MOUSEEXIT, modifierkey=KB_NONE, responsecode=RE_MOUSEEXITTAB);
	IE.LoadEventBehavior(
		location=tbar, eventkey=eventkey,
		responsetype='event_responses', response=response);	

	response = IE.Response(type='image', imageindex=3);
	eventkey = IE.EventKey(
		action=IE_MOUSEENTER, modifierkey=KB_NONE, responsecode=RE_MOUSEENTERSELTAB);
	IE.LoadEventBehavior(
		location=tbar, eventkey=eventkey,
		responsetype='event_responses', response=response);	

	response = IE.Response(type='image', imageindex=4);
	eventkey = IE.EventKey(
		action=IE_MOUSEEXIT, modifierkey=KB_NONE, responsecode=RE_MOUSEEXITSELTAB);
	IE.LoadEventBehavior(
		location=tbar, eventkey=eventkey,
		responsetype='event_responses', response=response);	

	return ER_OK;
}

