initialize()=
declare
	fields			= array of FormField default null;
	i				= integer not null;
enddeclare
{
	/*
	**	Use the second image in the BgBitmap compound bitmap, as this illustrates
	**	the demonstration more clearly
	*/
	fields = curframe.TopForm.FieldsByProperty();
	for i = 1 to fields.LastRow do
		fields[i].UpdBackground(imageindex=2);
	endfor;
}


