enddeclare
{
}


on click gobtn =
{
	if field(sub.sizedsub).SizeToFit != STF_PARENT then
		field(sub.sizedsub).SizeToFit = STF_PARENT;
	else
		field(sub.sizedsub).SizeToFit = STF_FRAME;
	endif;
}


on click closebtn =
{
	return;
}


on click sub.sizedsub.helpbtn =
{
	field(sub.sizedsub).SetAttribute(
		childrightmargin=inset, childtopmargin=inset);
	inset = inset + 37;
}

