	SetupProgressBar		= procedure returning integer not null;
	BuildProgressBehavior	= procedure returning integer not null;
	SetupTvf				= procedure returning integer not null;
	BuildGraphBehavior		= procedure returning integer not null;
	SetupStyle				= procedure returning array of Object;
enddeclare
{
	/*
	**	Ensure system calls are asynchronous and windowless
	*/
	cursession.ProcessWait = FALSE;
	cursession.ProcessWindow = FALSE;

	/*
	**	Set some useful variables
	*/
	topf = curframe.TopForm;
	stopf = FrameSource(curframe.ObjectSource).TopForm;
	if topf.FetchTaggedValue(tag='simulation') is not null then
		hassimuldata = TRUE;
	endif;

	progbar = field(progressbar);
	marqbar = field(busybar);
	graphfoot = field(startcount).ParentField;
	sdfilename = filedefsdir + fd$ + '_stemdirs.txt';
	pixeldensity = Float8(cursession.PixelScreenWidth)/Float8(cursession.ScreenWidth);
	barh = Float8(progbar.Height) * pixeldensity - 1;

	/*
	**	Setup the marqueebar
	**	Setup the progressbar (marqueebar is prestored, so should this be)
	**	Setup the graph
	**
	**	(We are using the same trigger key for both bars - they are different
	**	fields, so the same key is fine; the key is 1024_0_101)
	*/
	status = SetupMarqueeBar(
		bar=marqbar, triggerkey=Byref(triggerkey), barkey=Byref(marqkey));
	status = SetupProgressBar(
		bar=progbar, triggerkey=Byref(triggerkey), barkey=Byref(progkey));
	status = SetupTvf(
		triggerkey=Byref(marqkey));

}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Rearrange the tree using drag and drop
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on dragdrop filetree =
declare
	info			= DragInfo default null;
	indx			= integer not null default 1;
	node			= TreeNode default null;
	name			= varchar(256) not null;
enddeclare
{
	info = curframe.MessageObject;

	$INFO('dragged node was ' + tvf.TriggerNode.TextLabel);
	node = tvf.TriggerNode.NextSibling;
	if node is not null then
		name = node.TextLabel;
	else
		name = '<null>';
	endif;
	$INFO('dragged node''s next node is ' + name);

	$INFO('drop location was ' + tvf.CurNode.TextLabel);

	if info.KeyState = KB_NONE then
		tvf.CurNode = tvf.Tree.MoveNode(
			sourcenode=tvf.TriggerNode, destnode=tvf.CurNode);
	else
#if 0 --
		node = tvf.CurNode;
		indx = 1;
		while node.PrevSibling is not null do
			indx = indx + 1;
			$INFO('prev node was ' + node.PrevSibling.TextLabel + ', indx=' + varchar(indx));
			node = node.PrevSibling;
		endwhile;
#else --
		node = tvf.CurNode.ParentNode.FirstChild;
		indx = 1;
		while node != tvf.CurNode do
			$INFO('Next node is ' + node.TextLabel + ', indx=' + varchar(indx));
			indx = indx + 1;
			node = node.NextSibling;
		endwhile;
#endif --
		$INFO('childnumber='+varchar(indx));
		tvf.CurNode = tvf.Tree.MoveNode(
			sourcenode=tvf.TriggerNode, destnode=tvf.CurNode.ParentNode,
			relation=TN_NUMBEREDCHILD, childnumber=indx);
	endif;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	List and count all folders named 'images'
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on click countbtn =
declare

enddeclare
{
	curframe.StatusText = '';

	/*
	**	Prepare the 'images'-directories-list file
	*/
	folderstring.LeftTruncate();
	folderstring.WriteToFile(filename=sdfilename);
	IOstatus = folderstring.ErrorStatus;
	/*SIMUL*/	IOstatus = ER_FAIL;

	/*
	**	Highlight the count button and entryfield
	*/
	field(countbtn).UpdBackground(imageindex=2);
	field(fldrcount).FgColor = CC_ORANGE;

	/*
	**	Prepare the Windows command to list the 'images' directories;
	**	Execute it asynchronously;
	**	Trigger a userevent loop to monitor the progress of the listing
	*/
	fptrn = 'images' + '.?';
	cmd = '@pushd "' + stemfolder + fd$ + '" & ' +
		'@dir /s /b /ad ' + fptrn + ' >"' +
		filedefsdir + fd$ + '_stemdirs.txt" & ' +
		'@popd';
	call system :cmd;

	curframe.SendUserEvent('checking');
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Run a userevent loop to monitor folder-listing progress
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	This uses a marquee bar to indicate that processing is going on, as we do not
**	know what constitutes completion until it happens.
*/
on userevent 'checking' =
declare
	confirmed			= integer not null default FALSE;
	i					= integer not null;
	j					= integer not null;
	path				= array of StringObject default null;
	relative			= TreeNode default null;
enddeclare
{
	confirmed = curframe.MessageInteger;

	/*
	**	Read the contents of the directory-list file at this point;
	**	Put each foldername into a separate stringobject 
	*/
	if IOstatus = ER_OK then
		folderstring.FileHandle = sdfilename;
		if hassimuldata = FALSE then
			stopf.SetTaggedValue(
				tag='simulation#folders' + varchar(fct), item=folderstring);
			folderstring = folderstring.Duplicate();
		endif;
	else
/*SIMUL*/ topf.FetchTaggedValue(
			tag='simulation#folders' + varchar(fct), item=Byref(folderstring));
	endif;

	folders = folderstring.Split(delimiter=HC_NEWLINE);
	fct = fct + 1;

	/*
	**	Stop the monitoring and prepare to tree
	**	..if the count of folders has not increased for the last 2 rounds
	*/
	if fldrcount = folders.LastRow and fldrcount != 0 and confirmed = TRUE then

		/*
		**	Stop the userevent loop;
		**	Stop the marquee;
		**	Stop the count highlighting;
		**	Enable the tree image-nodes button;
		**	Add a tree node for each folder found;
		**	Resume
		*/
		curframe.PurgeUserEvent('checking');

		IE.StopEventBehavior(eventkey=marqkey, location=marqbar);
		marqbar.UpdBackground(spritemap=empty);

		field(countbtn).UpdBackground(imageindex=1);
		field(fldrcount).FgColor = CC_BLACK;
		field(treebtn).CurBias = FB_CHANGEABLE;

		graphfoot.SetAttribute(sizetofit=STF_SELF, outerwidth=field(filetree).Width);
		curframe.Flush();
		graphfoot.SetAttribute(sizetofit=STF_PARENTHORIZONTAL);

		tvf.Tree.RootNode.IsExpanded = TRUE;

		resume;
	endif;

	/*
	**	add a tree node for each newly listed folder
	*/
	for i = fldrcount+1 to folders.LastRow do
		path = folders[i].Split(delimiter=fd$);
		for j = 1 to curnodes.LastRow do
			if curnodes[j].TextLabel != path[j].Value then
				endloop;
			endif;
		endfor;

		while curnodes.LastRow > j-1 do
			curnodes.RemoveRow(rownumber=curnodes.lastRow);
		endwhile;
		if curnodes.LastRow > 0 then
			relative = curnodes[curnodes.LastRow];
		endif;
		for j = j to path.LastRow do
			curnodes[j] = tvf.Tree.AddNode(
				name=path[j].Value, relative=relative);
			curnodes[j].BitmapLabelIndex = 1;
			curnodes[j].SelectedBitmapLabelIndex = 1;
			if Lowercase(curnodes[j].TextLabel) = 'images' then
				curnodes[j].KeyLabel = folders[i].Value;
			endif;
			relative = curnodes[j];
		endfor;
	endfor;

	if fldrcount = folders.LastRow and fldrcount != 0 then
		confirmed = TRUE;
	endif;


	fldrcount = folders.LastRow;
	marqbar.ToolTipText = folderstring.Value;

	curframe.SendUserEvent('checking', delay=1, messageinteger=confirmed);
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	List, count and tree all image files in the listed 'images' folders
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	This uses a progress bar to indicate that processing is going on, as we now
**	know what constitutes completion (all the listed files examined).
**
**	The list traverse is driven by a for-loop/userevent-loop combination
**	(restarting the for-loop at i rather than 1 each time); the userevent loop -
**	occurring every 25 "for" iterations - gives any Cancel click the opportunity
**	to be applied)
*/
on userevent 'click treebtn',
on click treebtn =
declare
	j			= integer not null;
	k			= integer not null;
	ct			= integer not null;
	fromct		= integer not null;
	tokens		= array of StringObject default null;
	bitmaptypestring	= StringObject;
	step			= integer not null;
	ict			= integer not null;
	relative	= TreeNode default null;
	node		= TreeNode default null;
	path		= array of StringObject default null;
	filename	= varchar(256) not null;
	label		= varchar(256) not null;
	string		= StringObject;
enddeclare
{
	/*
	**	Initialize the counters &
	**	Disable shielding (so we can cancel if bored) &
	**	Setup for each bitmap type
	**	..if we are (re)starting the tree
	*/
	if curframe.EventType = 'Click' then
		i = 0;

		curframe.BlocksFrames = FALSE;
		curframe.StatusText = '';

		/*
		**	Setup for each image-type
		*/
		bitmaptypestring.Value = 'bmp jpg gif';
		bitmaptypes = bitmaptypestring.Split(delimiter=' ');

		for j = 1 to bitmaptypes.LastRow do
			/*
			**	Create a dynexpr to populate the counter for the image-type;
			**	Create a SpriteDescriptor entry for graphing the image-type count;
			**	Create an empty file for the list of files of this image-type
			*/
			dyns[j] = curframe.Scope.CreateDynExpr(string=bitmaptypes[j].Value);
			dyns[j].SetValue(value=0);
			SDS.InsertRow();
			fnames[j].Value =
				filedefsdir + fd$ + bitmaptypes[j].Value + '_files.txt';
			fnames[j].WriteToFile(filename=fnames[j].Value);
		endfor;
	endif;

	/*
	**	List and count the imagefiles in each of the listed folders
	*/
	for i = i + 1 to folders.LastRow do

		/*
		**  Do a userevent loop ..if we have done 24 iterations since the last one
		*/
		if Mod(i,fldrcount/25) = 0 and offercancel = TRUE then
			curframe.SendUserEvent('option to cancel');
			resume;
		endif;
		offercancel = TRUE;

		/*
		**	List and count each of the image filetypes we are interested in;
		**	Make the counts cumulative
		*/
		ict = 0;
		foldername = folders[i].Value;
		relative = tvf.Tree.NodeByKey(foldername);
		if relative is null then
			continue;
		endif;

		for j = 1 to bitmaptypes.LastRow do

			/*
			**	Prepare the Windows command to list the files of this type;
			**	Execute it (asynchronously)
			*/
			fptrn = '*.' + bitmaptypes[j].Value;
			fname = fnames[j].Value;
			cmd = '@pushd "' + foldername + fd$ + '" & ' +
				'@dir /b ' + fptrn + ' >"' + fname + '" & ' +
				'@popd';
			call system :cmd;

			/*
			**	Read the contents of the file-list file at this point;
			**	Put each filename into a separate stringobject 
			*/
			if IOstatus = ER_OK then
				filestring.FileHandle = fname;
				if hassimuldata = FALSE then
					stopf.SetTaggedValue(
						tag='simulation#files' + varchar(fict), item=filestring);
					filestring = filestring.Duplicate();
				endif;
			else
/*SIMUL*/		topf.FetchTaggedValue(
					tag='simulation#files' + varchar(fict), item=Byref(filestring));
			endif;

			fict = fict + 1;

			if Squeeze(filestring.Value) not like Concat(
				'%.', bitmaptypes[j].Value) then
				continue;
			endif;
			tokens = filestring.Split(delimiter=HC_NEWLINE);

			/*
			**  Add the count of found bitmaps to the total bitmaps of this type;
			**	Hold the previous count too (needed for the folder node subtotals)
			*/
			dyns[j].GetValue(value=Byref(ct));
			fromct = ct;
			ct = ct + tokens.LastRow;
			dyns[j].SetValue(value=ct);

			/*
			**  Create a treenode for each found imagefile;
			**	Cumulate the images found in this folder
			*/
			if ct = 0 then
				continue;
			endif;

			for k = 1 to tokens.LastRow do
				filename = tokens[k].Split(
					delimiter=fd$, backwards=TRUE, exactrows=2)[1].Value;
				node = tvf.Tree.AddNode(name=filename, relative=relative);
				node.BitmapLabelIndex = j+1;
				node.SelectedBitmapLabelIndex = j+1;
			endfor;

			ict = ict + tokens.LastRow;
		endfor;

		/*
		**	Amend the folder node textvalue to show the count of found files
		**
		**	(need preserveblanklasttoken=TRUE to keep the close parenthesis)
		*/
		label = relative.TextLabel;
		if label not like '%(%)' then
			label = label + ' (0)';
		endif;
		tokens = ToString(text=label).Split(
			delimiter='(\,)', includedelimiter=TRUE, preserveblanklasttoken=TRUE);
		tokens[3].Value = Varchar(Int4(tokens[3].Value) + ict);
		relative.TextLabel = string.Join(strings=tokens).Value;

		relative.SetAttribute(
			IsVisible = TRUE, FgColor=CC_RED, /*BgColor=CC_BLUE,*/ IsBold=TRUE);

		/*
		**	Tell the progress bar
		*/
		step = (i*100)/folders.LastRow;
		if step > laststep + stepsize then
			IE.TriggerEventBehavior(location=progbar,
				eventkey=triggerkey, startindex=laststep, stopindex=step);
			laststep = step;
		endif;

	endfor;

	tvf.TopNode = tvf.Tree.RootNode;

	curframe.BlocksFrames = TRUE;
	curframe.StatusText = 'done';
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Run a userevent loop enable a cancel
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on userevent 'option to cancel' =
{
	if cancel = FALSE then
		offercancel = FALSE;
		i = i - 1;
		curframe.SendUserEvent('click treebtn', delay=0.01);	//delay is essential
		resume;
	endif;

	curframe.BlocksFrames = TRUE;
	curframe.PurgeUserEvent('click treebtn');
	cancel = FALSE;
	curframe.StatusText = 'cancelled';
}


