/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Set up the progress bar
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupProgressBar(

	bar				= FormField default null;
	barkey			= varchar(32) not null;
	triggerkey		= varchar(32) not null;

)=
declare
	response		= Object default null;
	progresskey		= varchar(32) not null;
enddeclare
{
	/*
	**	Get the triggerkey, and the progresskey it will trigger
	*/
	if triggerkey = '' then
		triggerkey = IE.EventKey(
			action=IE_USER, modifierkey=KB_NONE, responsecode=RE_USERDEFAULT);
	endif;

	progresskey = IE.EventKey(
		action=IE_TICKPOINT, modifierkey=KB_NONE, responsecode=RE_ANIMATE);

	/*
	**	Load the "trigger" event-behavior
	**  (This is stored in the progressbar, but could be anywhere sensible)
	*/
	response = IE.Response(type='redirect',
		responsekey=progresskey, responsefield=bar);
	IE.LoadEventBehavior(location=bar, responsetype='event_responses',
		eventkey=triggerkey, response=response, makepermanent=FALSE);

	/*
	**	Load the progress event-behavior that will be triggered
	**  (This is stored in the progressbar, but could be anywhere sensible)
	*/
	status = BuildProgressBehavior(bar=bar, progresskey=progresskey);

	return ER_OK;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Build and store the progress behavior
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure BuildProgressBehavior(

	bar 		= SubForm default null;
	progresskey	= varchar(32) not null;

)=
declare
	SDS			= array of SpriteDescriptor;
	i			= integer not null default 0;
	width		= integer not null default 0;
	nextwidth	= integer not null default 0;
	w			= integer not null default 0;
	xbe			= integer not null default 0;
	widthbe		= integer not null default 8;
	y2			= integer not null default 0;
	y3			= integer not null default 0;
	h2			= integer default null;
	w2			= integer default null;
	responseset	= array of Object;
enddeclare
{
	for i = 1 to 3 do SDS.InsertRow(rownumber=i); endfor;

	for i = 1 to 100 do

		/*
		**	Compute the bar width (%);
		**	Compute the start of the right bookend (%);
		*/
		width = i;
		xbe = width-widthbe+1;

		/*
		**	Compute the size and position of the bookends as follows:
		**	- Hide the left bookend ..if it would be partly offscreen;
		**	- Display the left bookend compressed ..until there is enough room for it;
		**	- Hide the right bookend ..until the left bookend is fully uncompressed;
		**	- Display the right bookend ..thereafter;
		*/
		if xbe < 1 then
			y2 = -barh;
		else
			y2 = 1;
		endif;

		if xbe < widthbe+1 then
			y3 = -barh; w2 = xbe; h2 = barh;
		else
			y3 = 1; w2 = null; h2 = null;
		endif;

		if xbe < 1 then
			xbe = 1;
		endif;

		/*
		**	Build the descriptors for this width
		*/
		SDS[1].SetAttribute(spritesourceindex=1,
			width=width, height=barh, x=1, y=1, widthunit='%');
		SDS[2].SetAttribute(spritesourceindex=2,
			width=w2, height=h2, x=1, y=y2);
		SDS[3].SetAttribute(spritesourceindex=3,
			width=widthbe, height=barh, x=xbe, y=y3, xunit='%', widthunit='%');

		/*
		**	Build the response and add it to the responseset
		*/
		IE.Response(type='sprite', responseset=responseset,
			descriptors=SDS, maptype='add');

	endfor;

	/*
	**	Store the responseset ready for use
	*/
	IE.LoadEventBehavior(location=bar, responsetype='event_responses',
		eventkey=progresskey, response=responseset, makepermanent=FALSE);
}



/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Set up the marquee bar
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupMarqueeBar(

	bar				= FormField default null;
	barkey			= varchar(32) not null;
	triggerkey		= varchar(32) not null;

)=
declare
	response		= Object default null;
	marqueekey		= varchar(32) not null;
enddeclare
{
	/*
	**	Get the triggerkey, and the marqueekey it will trigger
	**	(the mouseup will fire the processing, no need for a TriggerEventBehavior)
	*/
	if triggerkey = '' then
		triggerkey = IE.EventKey(
			action=IE_LMOUSEUP, modifierkey=KB_NONE, responsecode=RE_USERDEFAULT);
	endif;

	marqueekey = IE.EventKey(
		action=IE_TICKPOINT, modifierkey=KB_NONE, responsecode=RE_ANIMATE);
	barkey = marqueekey;

	/*
	**	Load the "trigger" event-behavior
	**  (This is stored in the marqueebar, but could be anywhere sensible)
	*/
	response = IE.Response(type='redirect', timebased=TRUE,
		responsekey=marqueekey, responsefield=bar);
	IE.LoadEventBehavior(location=field(countbtn), responsetype='event_responses',
		eventkey=triggerkey, response=response, makepermanent=FALSE);

	/*
	**	Load the marquee event-behavior that will be triggered
	**  (This is stored in the marqueebar, but could be anywhere sensible)
	*/
	status = BuildMarqueeBehavior(bar=bar, marqueekey=marqueekey);

	return ER_OK;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Build and store the marquee behavior
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure BuildMarqueeBehavior(

	bar 		= SubForm default null;
	marqueekey	= varchar(32) not null;
	style			= varchar(32) not null default 'zigzag';

)=
declare
	marqresponse	= array of Object default null;
	intervals		= array of IntegerObject;
enddeclare
{
	/*
	**  Setup and load the marqueebar behaviour
	*/
	marqresponse = SetupStyle(intervals=Byref(intervals), style=style);

	IE.LoadEventBehavior( location=marqbar, eventkey=marqueekey,
		responsetype='event_responses', response=marqresponse,
		intervals=intervals,
		makepermanent=FALSE);

	return ER_OK;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Setup the marquee behavior
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupStyle(

	intervals		= array of IntegerObject default null;
	style			= varchar(32) not null default 'zigzag';

)=
declare
	marqresponse	= array of StringObject;
	x			= integer not null;
	y			= integer not null default 1;
	w			= integer not null;
	i			= integer not null;
	plus			= varchar(32) not null;
	minus			= varchar(32) not null;
	movement		= varchar(32) not null;
	pulseid			= integer not null default 1;
	pulsew			= integer not null default 106;
	steps			= integer not null;
enddeclare
{
	/*
	**  Compute how many 2-pixel steps to cross the field
	*/
	w = marqbar.Width * pixeldensity;
	steps = ( w + pulsew ) / 2;

	/*
	**  Create an array of all the responses to move across and/or back
	**
	**  each has the format "+-next;previous"
	**  where next and previous specify "sprite x,y"
	*/
	x = 0 - pulsew;

	for i = 1 to steps do
		minus = varchar(pulseid) + ' ' + varchar(x) + ',' + varchar(y);
		x = x + 2;
		plus = varchar(pulseid) + ' ' + varchar(x) + ',' + varchar(y);
		movement = '+-' + plus + ';' + minus;

		marqresponse[i].Value = movement;
	endfor;

	if style = 'zigzag' then
		for i = steps+1 to steps*2 do
			minus = varchar(pulseid) + ' ' + varchar(x) + ',' + varchar(y);
			x = x - 2;
			plus = varchar(pulseid) + ' ' + varchar(x) + ',' + varchar(y);
			movement = '+-' + plus + ';' + minus;

			marqresponse[i].Value = movement;
		endfor;
	endif;

	/*
	**  We only need to specify one interval
	*/
	intervals[1].Value = 5;	//msec

	return marqresponse;	//intervals is returned byref
}



/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Set up the TreeViewField
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupTvf(

	bar				= FormField default null;
	triggerkey		= varchar(32) not null;

)=
declare
	response		= Object default null;
	progresskey		= varchar(32) not null;
	i				= integer not null;
	itrim			= ImageTrim default null;
enddeclare
{
	marqkey = IE.EventKey(action=IE_TICKPOINT, modifierkey=KB_NONE,
		responsecode=RE_ANIMATE);

	IE.LoadEventBehavior( location=field(treebtn), eventkey=marqkey,
		responsetype='event_responsefields', response=progbar,
		makepermanent=FALSE);

	tvf = field(filetree);
	for i = 1 to field(treeicons).ChildFields.LastRow do
		itrim = field(treeicons).ChildFields[i];
		tvf.ImageList[i] = itrim.Image.Duplicate();
	endfor;

	tvf.IsDragSource = TRUE;
	tvf.DragObject = null;
	tvf.DropObject = 'treeviewfield';

	return ER_OK;
}


